import React from "react";
import { useDispatch, useSelector } from "react-redux";
import "../styles/Blog.css";
import { IPostState } from "../store/index";

interface Post {
  post: IPostState[];
}

const Blog: React.FC = () => {
  const postList = useSelector((state: Post) => state.post);
  //   postList.map((list: IPostState) => console.log(list));
  return postList.map((list: IPostState) => (
    <div>
      <div>{list.title}</div>
      <div>{list.author}</div>
      <div>{list.text}</div>
    </div>
  ));
};

export default Blog;
